import React, { Component } from "react";
import { Menu, Icon } from "semantic-ui-react";
import { Link } from "../routes";

export default () => {
    return (
        <Menu style = {{ marginTop: "10px" }} >
            <Link route = "/">
                <a className = "item">
                    CrowdCoin
                </a>
            </Link>
            <Menu.Menu position = "right">
                <Menu.Item>
                    Campaigns
                </Menu.Item>
                <Menu.Item>
                    <Icon name='plus' />
                </Menu.Item>
            </Menu.Menu>
        </Menu>
    );
}
